import React, { Component } from 'react'
import waveup from '../../img/wave(1).svg'
import wavedown from '../../img/wave(2).svg'
export default class Home extends Component {
    render() {
        return (
            <div>
                <div className="downWave">
                    <img src={wavedown}/>
                </div>
                <img className="upWave" src={waveup}/>
            </div>
        )
    }
}
